import {urls} from '../constants';
import store from './../Store/index'

export function getParties(onSuccess, onError){
    var myHeaders = new Headers();
    myHeaders.append("Authorization", 
    "eyJhbGciOiJIUzUxMiJ9.eyJqdGkiOiJkb21vd2thSldUIiwic3ViIjoiU3lsd2VhayIsImF1dGhvcml0aWVzIjpbIlJPTEVfVVNFUiJdLCJpYXQiOjE2MTYwNjIyMDEsImV4cCI6MTYxNjA2MjgwMX0.Ua48vLvL-8iFzbHQcR8zH79-b5J--q48qu83_ajDmo0rYz5DLR6jV6-By2bsbbfrT7I3o3rvnlAXD6tzu8J7Dg");
    fetch(urls.partyUrl, {method: 'GET', headers: myHeaders})
    .then(response => response.json())
    .then(result =>{ 
        onSuccess(result);
        //store.dispatch({ type: 'party/getList', payload: result })

    })
    .catch(error => onError? onError():console.log(error));
}
